import React, { useState, useEffect } from 'react';
import {
  Alert, Box, Button, Grid, TextField, Typography, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow,
} from '@mui/material';
import { Stack } from '@mui/system';
import SearchIcon from '@mui/icons-material/Search';
import ClearIcon from '@mui/icons-material/Clear';
import EditIcon from '@mui/icons-material/Edit';
import axios from 'axios';
import { useFormik } from 'formik';
import moment from 'moment';

const Instances = () => {
  const [searchText, setSearchText] = useState('');
  const [projectData, setProjectData] = useState([]);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [showSearchResult, setShowSearchResult] = useState(false);

  const initialFormValues = {
    projectName: '',
  };

  useEffect(() => {
    document.getElementById('searchText')?.focus();
  }, []);

  const formik = useFormik({
    initialValues: initialFormValues,
    onSubmit: (values) => {
      fetchData(values.projectName);
    },
  });

  const fetchData = async (searchTerm) => {
    setLoading(true);
    try {
      const response = await axios.get(`http://localhost:8000/api/sshData?find=${searchTerm}`);
      setProjectData(response.data);
      setError(null);
      setShowSearchResult(true);
    } catch (error) {
      console.error('Error fetching data:', error);
      setError('Error fetching data. Please try again.');
    }
    setLoading(false);
  };

  const handleReset = () => {
    formik.resetForm();
    setShowSearchResult(false);
    setProjectData([]);
  };

  const handleClick = async (idx) => {
    try {
      const data = projectData[idx];
      await fetch('http://localhost:8000/api/validatessh', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          awsAccessKey: data.awsAccessKey,
          awsSecretKey: data.awsSecretKey,
          sshUser: data.sshUser,
          region: data.region,
          sshIpAddress: data.sshIpAddress,
          sshKeyFilePath: data.sshKeyFilePath,
        }),
      });
    } catch (error) {
      console.log('Something went wrong check for the data', error);
      setError('Error fetching data');
    }
  };

  const handleScript = async (idx) => {
    try {
      const data = projectData[idx];
      await fetch('http://localhost:8000/api/synctotarget', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          awsAccessKey: data.awsAccessKey,
          awsSecretKey: data.awsSecretKey,
          sshUser: data.sshUser,
          region: data.region,
          sshIpAddress: data.sshIpAddress,
          sshKeyFilePath: data.sshKeyFilePath,
          targetSshUser: data.targetSshUser,
          targetAuthMethod: data.targetAuthMethod,
          targetSshPassword: data.targetSshPassword,
          targetSshPort: data.targetSshPort,
          targetIpAddress: data.targetIpAddress,
          targetSshKeyFilePath: data.targetSshKeyFilePath,
        }),
      });
    } catch (error) {
      console.log('Something went wrong check for the data', error);
      setError('Error fetching data');
    }
  };

  return (
    <Box margin={3} component="form" onSubmit={formik.handleSubmit}>
      {showSearchResult ? (
        <>
          <Box sx={{ display: 'flex', marginBottom: 2 }}>
            <Alert
              severity="info"
              icon={false}
              sx={{ display: 'block', textAlign: 'left', flexGrow: 1 }}
            >
              <Typography gutterBottom>
                <span>Search Results for: {searchText}</span>
              </Typography>
            </Alert>
            <Button
              variant="contained"
              size="small"
              sx={{ marginRight: 0.5 }}
              onClick={(e) => {
                e.preventDefault();
                setShowSearchResult(false);
              }}
            >
              <EditIcon fontSize="small" />
            </Button>
          </Box>
          <div style={{ height: 450, width: '100%' }}>
            <div style={{ display: 'flex', height: '100%' }}>
              <div style={{ flexGrow: 1 }}>
                <TableContainer component={Paper}>
                  <Table>
                    <TableHead>
                      <TableRow>
                        <TableCell>ID</TableCell>
                        <TableCell>Project Name</TableCell>
                        <TableCell>SSH User</TableCell>
                        <TableCell>Region</TableCell>
                        <TableCell>SSH Port</TableCell>
                        <TableCell>SSH IP Address</TableCell>
                        <TableCell>SSH Key File Path</TableCell>
                        <TableCell>Target SSH User</TableCell>
                        <TableCell>Target Auth Method</TableCell>
                        <TableCell>Target SSH Port</TableCell>
                        <TableCell>Target IP Address</TableCell>
                        <TableCell>Target SSH Key File Path</TableCell>
                        <TableCell>Action</TableCell>
                        <TableCell>Output</TableCell>
                      </TableRow>
                    </TableHead>
                    <TableBody>
                      {projectData.map((project, idx) => (
                        <TableRow key={project._id}>
                          <TableCell>{project._id}</TableCell>
                          <TableCell>{project.projectName}</TableCell>
                          <TableCell>{project.sshUser}</TableCell>
                          <TableCell>{project.region}</TableCell>
                          <TableCell>{project.sshPort}</TableCell>
                          <TableCell>{project.sshIpAddress}</TableCell>
                          <TableCell>{project.sshKeyFilePath}</TableCell>
                          <TableCell>{project.targetSshUser}</TableCell>
                          <TableCell>{project.targetAuthMethod}</TableCell>
                          <TableCell>{project.targetSshPort}</TableCell>
                          <TableCell>{project.targetIpAddress}</TableCell>
                          <TableCell>{project.targetSshKeyFilePath}</TableCell>
                          <TableCell>
                            <Button variant="contained" onClick={() => handleClick(idx)}>
                              Validate SSH
                            </Button>
                          </TableCell>
                          <TableCell>
                            <Button variant="contained" onClick={() => handleScript(idx)}>
                              Sync to Target
                            </Button>
                          </TableCell>
                        </TableRow>
                      ))}
                    </TableBody>
                  </Table>
                </TableContainer>
              </div>
            </div>
          </div>
        </>
      ) : (
        <Stack>
          <Box sx={{ display: 'flex', marginBottom: 0.5 }}>
            <TextField
              fullWidth
              variant="filled"
              label="Search by Project Name"
              size="small"
              id="searchText"
              name="searchText"
              value={formik.values.projectName}
              onChange={formik.handleChange}
              onBlur={formik.handleBlur}
            />
            <Button
              variant="contained"
              size="small"
              sx={{ marginRight: 0.5 }}
              type="submit"
            >
              <SearchIcon fontSize="small" />
            </Button>
            <Button
              variant="contained"
              size="small"
              sx={{ bgcolor: 'text.secondary' }}
              onClick={handleReset}
            >
              <ClearIcon fontSize="small" />
            </Button>
          </Box>
        </Stack>
      )}
    </Box>
  );
};

export default Instances;
